INSERT INTO resultado_aprendizaje VALUES (220501007-04,'Realizar la codificación de los módulos del sistema y el programa principal, a partir de la utilización del lenguaje de programación seleccionado, de acuerdo con las especificaciones del diseño.',220501007,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501007-05,'Construir el programa de instalación del aplicativo, utilizando las herramientas de desarrollo disponibles en el mercado, según las características de la arquitectura de la solución.',220501007,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501007-06,'Elaborar el manual técnico de la aplicación, de acuerdo con la complejidad del aplicativo y según normas y procedimientos establecidos por la empresa.',220501007,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501007-07,'Ejecutar y documentar las pruebas del software, aplicando técnicas de ensayo-error, de acuerdo con el plan diseñado y los procedimientos establecidos por la empresa.',220501007,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501009-01,'Interpretar el diagnóstico de necesidades informáticas, para determinar las tecnológicas requeridas en el manejo de la información, de acuerdo con las normas y protocolos establecidos por la empresa.',220501009,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501009-02,'Definir estrategias para la elaboración de términos de referencia y procesos de evaluación de proveedores, en la adquisición de tecnología, según protocolos establecidos.',220501009,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501009-03,'Participar en los perfeccionamientos de contratos informáticos, estableciendo cláusulas técnicas, que respondan a las necesidades de los actores de la negociación, de acuerdo con la ley de contratación.','220501009',228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501009-04,'Elaborar el informe sobre el cumplimiento de los términos de referencia previstos en la negociación, de acuerdo con la participación de cada uno de los actores en relación con la satisfacción de los bienes informáticos contratados y recibidos, según normas y protocolos de la organización.',220501009,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501032-01,'Interpretar el informe de requerimientos, para determinar las necesidades tecnológicas en el manejo de la información, de acuerdo con las normas y protocolos establecidos en la empresa.',220501032,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501032-02,'Representa el bosquejo de la solución al problema presentado por el cliente, mediante la  elaboración de diagramas de casos de uso,  apoyado en el análisis del informe de requerimientos, al confrontar la situación problemica con el usuario según  normas y protocolos de la organización.',220501032,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501032-03,'Construir el modelo conceptual del macrosistema frente a los requerimientos del cliente,  mediante el uso e interpretación de la información levantada, representado en diagramas de clase, de interacción, colaboración y contratos de operación, de acuerdo con las diferentes secuencias, fases y procedimientos del sistema.',220501032,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501032-04,'Valorar la incidencia de los datos en los procesos del macrosistema, tomando como referente  el diccionario de datos y las miniespecificaciones, para la consolidación de los datos que intervienen, de acuerdo con parámetros establecidos.',220501032,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501032-05,'Elaborar el informe de los resultados del análisis del sistema de información, de acuerdo con los requerimientos del cliente  según normas y protocolos establecidos.',220501032,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501033-01,'Diseñar la arquitectura tecnológica  del sistema de información, mediante el reconocimiento de hardware y software, de acuerdo con la tecnología disponible en el mercado, el informe de análisis levantado y el diagrama de distribución.',220501033,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501033-02,'Diseñar la arquitectura del software, mediante la interpretación de las clases, objetos y mecanismos de colaboración, utilizando herramientas tecnológicas de diseño, de acuerdo con las tendencias de las tecnologías de la información y la comunicación.',220501033,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501033-03,'Construir el prototipo del sistema de información, a partir del análisis de las características funcionales del sistema en relación con facilidad de manejo, funcionalidad y experiencia del usuario, apoyado en software aplicado según protocolos de diseño.',220501033,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501033-04,'Diseñar la estructura de datos, a partir del modelo conceptual determinado en el análisis del sistema, utilizando herramientas tecnológicas de bases de datos, según las normas y estándares establecidos.',220501033,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501033-05,'Aplicar políticas y mecanismos de control en el diseño del sistema de información, mediante el análisis de la vulnerabilidad de la información, siguiendo los parámetros establecidos por la organización.',220501033,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501033-06,'Elaborar el informe de diseño del sistema de información, de acuerdo con la selección de las herramientas, tanto de software como de hardware, requeridas para la solución informática.',220501033,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501034-01,'Configurar el software de la aplicación para cliente y servidor, mediante la utilización del hardware disponible,  ejecutándola en la plataforma tecnológica, según normas y protocolos establecidos por la empresa.',220501034,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501034-02,'Elaborar el informe administrativo, siguiendo los protocolos de la organización, basado en los planes de instalación, respaldo y migración del sistema de información, facilitando la operatividad y mantenimiento de la solución informática.',220501034,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501034-03,'Definir estrategias para la  validación de manuales de usuario y de operación,  respondiendo a las necesidades y satisfacción del cliente, frente a la solución informática propuesta, según políticas de la organización',220501034,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501034-04,'Capacitar a los usuarios del sistema, sobre la estructuración y el manejo del aplicativo,  de acuerdo con el plan establecido, el perfil de los usuarios, según políticas de la organización.',220501034,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501034-05,'Elaborar informes técnicos relacionados con la solución informática implantada, de acuerdo con las propuestas de alternativas aplicadas, teniendo en cuenta las técnicas de comunicación y según normas y protocolos establecidos',220501034,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501035-01,'Identificar las características de los procesos de desarrollo de software, frente al referente de calidad adoptado por la empresa, ajustándolos a los resultados de las mediciones, evaluaciones y recomendaciones realizadas',220501035,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501035-02,'Identificar los puntos críticos de control en los procesos de desarrollo de software, para establecer las acciones a seguir, garantizando el cumplimiento de los estándares de calidad, siguiendo los lineamientos establecidos por la organización.',220501035,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501035-03,'Aplicar los estándares de calidad involucrados en los procesos de desarrollo de software, siguiendo el plan establecido para mantener la integridad de los productos  de trabajo definidos, según las prácticas de configuración establecidas por la empresa',220501035,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501035-04,'Elaborar instrumentos e instructivos, requeridos por el aseguramiento de la calidad, para documentar y evaluar los procesos de desarrollo de software, de acuerdo con las normas y procedimientos establecidas por la empresa',220501035,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501035-05,'Evaluar procesos y productos de desarrollo de software, documentar y concertar acciones a seguir, para garantizar el cumplimiento de las normas establecidas, de acuerdo con el plan definido y con los criterios de medición, métricas y políticas determinados por la empresa',220501035,228106,102);
INSERT INTO resultado_aprendizaje VALUES (220501035-06,'Elaborar el informe final del proceso de gestión de calidad en el desarrollo de software, que consolide la información de las evidencias, hallazgos y novedades frente al seguimiento y control de los productos, según normas internacionales y protocolos de la organización.',220501035,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-01,'Interactuar en los contextos Productivos y Sociales en función de los Principios y Valores Universales.  ',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-02,'Desarrollar permanentemente las habilidades psicomotrices y de pensamiento en la ejecución de los procesos de aprendizaje.',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-03,'Generar procesos autónomos y de trabajo colaborativo permanentes, fortaleciendo el equilibrio de los componentes racionales y emocionales orientados hacia el Desarrollo Humano Integral.',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-04,'Redimensionar permanentemente su proyecto de vida de acuerdo con las circunstancias del contexto y con visión prospectiva.',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-05,'Desarrollar procesos comunicativos eficaces y asertivos dentro de criterios de racionalidad que posibiliten la convivencia, el establecimiento de acuerdos, la construcción colectiva del conocimiento y la resolución de problemas de carácter productico y social. ',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-06,'Asumir responsablemente los criterios de preservación y conservación del medio ambiente y de desarrollo sostenible, en el ejercicio de su desempeño laboral y social. ',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-07,'Generar hábitos saludables en su estilo de vida para garantizar la prevención de riesgos ocupacionales de acuerdo con el diagnóstico de su condición física individual y la naturaleza y complejidad de su desempeño laboral . ',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-08,'Aplicar técnicas de cultura física para el mejoramiento de su expresión corporal, desempeño laboral según la naturaleza y complejidad del área ocupacional. ',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-10,'Reconocer el rol de los participantes en el proceso formativo, el papel de los ambientes de aprendizaje y la metodología de formación, de acuerdo con la dinámica organizacional del SENA. ',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-12,'Gestionar la información de acuerdo con los procedimientos establecidos y con las tecnologías de la información y la comunicación disponibles.',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-13,'Identificar las oportunidades que el Sena ofrece en el marco de la formación profesional de acuerdo con el contexto nacional e internacional.',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201500-14,'Concertar alternativas y acciones de formación para el desarrollo de las Resultado_Aprendizajes del programa formación, con base en la política institucional. ',240201500,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201501-01,'Comprender frases y vocabulario habitual sobre temas de interés personal y temas técnicos.',240201501,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201501-02,'Comprender la idea principal en avisos y mensajes breves, claros y sencillos en inglés técnico. ',240201501,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201501-03,'Leer textos muy breves y sencillos en inglés general y técnico. ',240201501,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201501-04,'Encontrar información específica y predecible en escritos sencillos y cotidianos. ',240201501,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201501-05,'Encontrar vocabulario y expresiones de inglés técnico en anuncios, folletos, páginas web, etc',240201501,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201501-06,'Comunicarse en tareas sencillas y habituales que requieren un intercambio simple y directo de información cotidiana y técnica',240201501,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201501-07,'Realizar intercambios sociales y prácticos muy breves, con un vocabulario suficiente para hacer una exposición o mantener una conversación sencilla sobre temas técnicos.',240201501,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201502-01,'Reproducir en inglés frases o enunciados simples que permitan expresar de forma lenta ideas o conceptos. ',240201502,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201502-02,'Identificar formas gramaticales básicas en textos y documentos elementales escritos en inglés. ',240201502,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201502-03,'Comprender una amplia variedad de frases y vocabulario  en inglés sobre temas de interés personal y temas técnicos. ',240201502,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201502-04,'Comprender las ideas principales de textos complejos en inglés que tratan de temas tanto concretos como abstractos, incluso si son de carácter técnico, siempre que estén dentro de su campo de especialización',240201502,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201502-05,'Leer textos complejos y con un vocabulario más específico, en inglés general y técnico. ',240201502,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201502-06,'Buscar de manera sistemática información específica y detallada en escritos en inglés, mas estructurados y con mayor contenido técnico. ',240201502,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201502-07,'Encontrar y utilizar sin esfuerzo vocabulario y expresiones de inglés técnico en artículos de revistas, libros especializados, páginas web, etc.',240201502,228106,102);
INSERT INTO resultado_aprendizaje VALUES (240201502-08,'Relacionarse con hablantes nativos en un grado suficiente de fluidez y naturalidad, de modo que la comunicación se realice sin esfuerzo por parte de los interlocutores.',240201502,228106,102);
