INSERT INTO proyecto VALUES (558200,'IMPLEMENTACION DE UNA RED DE DATOS CORPORATIVA MULTISERVICIO, ADMINISTRADA Y CONFIGURADA BAJO SISTEMA OPERATIVO LINUX',1,217219,3);
INSERT INTO fase VALUES ('Analisis',1,576887);
INSERT INTO fase VALUES ('Planeación',1,576887);
INSERT INTO fase VALUES ('Ejecución',1,569629);
INSERT INTO fase VALUES ('Evaluación',1,558200);
INSERT INTO actividad VALUES (1,'Actividades de  inducción en la formación profesional integral SENA.','Analisis',576887);
INSERT INTO actividad VALUES (2,'Determinar los requerimientos del sistema según especificaciones y lineamientos del proyecto.','Analisis',576887);
INSERT INTO actividad VALUES (3,'Analizar procesos, datos y necesidades del centro de electricidad, electronica y telecomunicaciones y el usuario final para el modulo especifico.','Analisis',576887);
INSERT INTO actividad VALUES (4,'Especificar Modelo Conceptual del sistema,especificando necesidades y requerimientos.','Planeación',576887);
INSERT INTO actividad VALUES (5,'Determinar la estructura lógica del sistema.','Planeación',576887);
INSERT INTO actividad VALUES (6,'Diseñar  la estructura tecnológica  del sistema integral.','Planeación',576887);
INSERT INTO actividad VALUES (7,'Desarrollar la estructura de datos y de vista de la aplicación del modulo.','Ejecución',569629);
INSERT INTO actividad VALUES (8,'Desarrollo los módulos del sistema integral web de acuerdo a los estándares de calidad y normatividad  legal vigente.','Ejecución',569629);
INSERT INTO actividad VALUES (9,'Preparar documentación del proceso de implantación del sistema.','Evaluación',558200);
INSERT INTO actividad VALUES (10,'Desarrollar las tareas de configuración y puesta en marcha del sistema.','Evaluación',558200);
INSERT INTO actividad VALUES (11,'Elaborar informes y procesos de evaluación para la validación de los productos e implantación del sistema determinanrecursos.','Evaluación',558200);
